$.ajax({url:"fares.json",dataType:"json",success:function(a){$.each(a.zones,function(b){var c="<option value='"+a.zones[b].zone+"'>"+a.zones[b].name;$("#zonesList").append(c)}),$("#zonesList").change(function(){var b=parseInt($(this).val());console.log("You selected Zone "+b);var c=parseInt($("#trips").val());console.log("Trips:"+c);var d=b-1,e=parseFloat(a.zones[d].fares[0].price);console.log("Price:"+e);var f=parseFloat(e*c);console.log("Total:"+f),$("#fareTotal").html("$ "+f)})}});